@mzelesky Awesome. That's a big improvement. Thanks Mark!
I notice [a few 041](https://catalog.princeton.edu/catalog?utf8=%E2%9C%93&search_field=all_fields&q=9927764163506421+OR+9932053003506421+OR+9923298553506421) still having un-separated language codes. Some escaped fish?

Has someone got an opportunity to examine no. 4 above, concerning 650 $v Texts? I tested [a bunch of indigenous languages,](https://catalog.princeton.edu/catalog?utf8=%E2%9C%93&search_field=advanced&sort=score+desc%2C+pub_date_start_sort+desc%2C+title_sort+asc&f1=all_fields&f2=all_fields&f3=title&op2=NOT&op3=AND&q1=&q2=%22Indigenous+Languages+%28Western+Hemisphere%29%22&q3=&f%5Bgenre_facet%5D%5B%5D=Texts&range%5Bpub_date_start_sort%5D%5Bbegin%5D=&range%5Bpub_date_start_sort%5D%5Bend%5D=&f1=all_fields&q1=&op2=NOT&f2=all_fields&q2=%22Indigenous+Languages+%28Western+Hemisphere%29%22&op3=AND&f3=title&q3=&f_inclusive%5Blanguage_facet%5D%5B%5D=Algonquian+%28Other%29&f_inclusive%5Blanguage_facet%5D%5B%5D=Central+American+Indian+%28Other%29&f_inclusive%5Blanguage_facet%5D%5B%5D=Dakota&f_inclusive%5Blanguage_facet%5D%5B%5D=Mayan+languages&f_inclusive%5Blanguage_facet%5D%5B%5D=Nahuatl&f_inclusive%5Blanguage_facet%5D%5B%5D=North+American+Indian+%28Other%29&f_inclusive%5Blanguage_facet%5D%5B%5D=Quechua&f_inclusive%5Blanguage_facet%5D%5B%5D=South+American+Indian+%28Other%29&f_inclusive%5Blanguage_facet%5D%5B%5D=Yupik+languages&f_inclusive%5Badvanced_location_s%5D%5B%5D=scsbcul&f_inclusive%5Badvanced_location_s%5D%5B%5D=scsbhl&f_inclusive%5Badvanced_location_s%5D%5B%5D=scsbnypl&range%5Bpub_date_start_sort%5D%5Bbegin%5D=&range%5Bpub_date_start_sort%5D%5Bend%5D=&sort=score+desc%2C+pub_date_start_sort+desc%2C+title_sort+asc&search_field=advanced&commit=Search) and think these results should be tagged as so, but are not.

This behavior changed between postgres 11 and 12.  My suspicion is the ["nondeterministic collations" change](https://www.postgresql.org/docs/12/collation.html#COLLATION-NONDETERMINISTIC). So, when we upgraded from Postgres 10 to 13, the alphabetization changed.

I verified this by `podman run -it -p 1234:5432 -e POSTGRES_PASSWORD=password postgres:12`, then `psql -h localhost -U postgres -W -p 1234 < ~/Desktop/ayn-tester.sql` with the following "ayn-tester.sql" file.

```
CREATE TABLE strings (string text);
INSERT INTO strings VALUES ('ibn al-arabi'), ('ibn al-ʻarabī'), ('ibn al-arabi'), ('ibn ʻAbd al-ʻAzīz'), ('ibn Abd al-Azīz');
SELECT * FROM strings ORDER BY string;
--- Expect ibn Abd al-Azīz and ibn ʻAbd al-ʻAzīz to be next to each other
```
